import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor() {
    super();

    this.state = {
      monesters: [
        {
          name: 'Frankestein',
          id: 'asdas2'
        },
        {
          name: 'Dracula',
          id: 'sad2'
        },
        {
          name: 'Zombie',
          id: 'eed3'
        }
      ]
    };
  }

render() {
  return (
    <div className="App">
      {
        this.state.monesters.map(monesters=> (
          <h1 key={monesters.id}>{monesters.name}</h1>
          ))
      }
    </div>
  );
}

}



export default App;
